/*
 * @lc app=leetcode id=1562 lang=cpp
 *
 * [1562] Find Latest Group of Size M
 *
 * https://leetcode.com/problems/find-latest-group-of-size-m/description/
 *
 * algorithms
 * Medium (40.64%)
 * Likes:    622
 * Dislikes: 130
 * Total Accepted:    17.3K
 * Total Submissions: 40.3K
 * Testcase Example:  '[3,5,1,2,4]\n1'
 *
 * Given an array arr that represents a permutation of numbers from 1 to n.
 *
 * You have a binary string of size n that initially has all its bits set to
 * zero. At each step i (assuming both the binary string and arr are 1-indexed)
 * from 1 to n, the bit at position arr[i] is set to 1.
 *
 * You are also given an integer m. Find the latest step at which there exists
 * a group of ones of length m. A group of ones is a contiguous substring of
 * 1's such that it cannot be extended in either direction.
 *
 * Return the latest step at which there exists a group of ones of length
 * exactly m. If no such group exists, return -1.
 *
 *
 * Example 1:
 *
 *
 * Input: arr = [3,5,1,2,4], m = 1
 * Output: 4
 * Explanation:
 * Step 1: "00100", groups: ["1"]
 * Step 2: "00101", groups: ["1", "1"]
 * Step 3: "10101", groups: ["1", "1", "1"]
 * Step 4: "11101", groups: ["111", "1"]
 * Step 5: "11111", groups: ["11111"]
 * The latest step at which there exists a group of size 1 is step 4.
 *
 *
 * Example 2:
 *
 *
 * Input: arr = [3,1,5,4,2], m = 2
 * Output: -1
 * Explanation:
 * Step 1: "00100", groups: ["1"]
 * Step 2: "10100", groups: ["1", "1"]
 * Step 3: "10101", groups: ["1", "1", "1"]
 * Step 4: "10111", groups: ["1", "111"]
 * Step 5: "11111", groups: ["11111"]
 * No group of size 2 exists during any step.
 *
 *
 *
 * Constraints:
 *
 *
 * n == arr.length
 * 1 <= m <= n <= 10^5
 * 1 <= arr[i] <= n
 * All integers in arr are distinct.
 *
 *
 */

// @lc code=start
class Solution
{
public:
    int findLatestStep(vector<int> &arr, int m)
    {
        int n = arr.size();
        if (m == n)
        {
            return n;
        }

        int step = -1;

        vector<int> len(n + 2);

        for (int i = 0; i < n; i++)
        {
            int l = len[arr[i] - 1];
            int r = len[arr[i] + 1];

            len[arr[i] - l] = l + r + 1;
            len[arr[i] + r] = l + r + 1;

            if (l == m || r == m)
            {
                step = i;
            }
        }

        return step;
    }
    int mergeIntervals(vector<int> &arr, int m)
    {
        map<int, int> data;
        unordered_set<int> pointers;
        int step = 1, res = -1;
        for (int a : arr)
        {
            data[a] = a + 1;
            auto it = data.lower_bound(a);
            if (it != begin(data))
                --it;
            while (next(it) != end(data) && it->second >= next(it)->first)
            {
                it->second = next(it)->second;
                data.erase(next(it));
            }
            if (it->second - it->first == m)
                pointers.insert(it->first);

            if (++it != end(data))
            {
                while (next(it) != end(data) && it->second >= next(it)->first)
                {
                    it->second = next(it)->second;
                    data.erase(next(it));
                }
                if (it->second - it->first == m)
                    pointers.insert(it->first);
            }

            erase_if(pointers, [&](int i)
                     { return data.find(i) == data.end() || data[i] - i != m; });
            if (!pointers.empty())
                res = step;
            step++;
        }
        return res;
    }
};
